import React from 'react';
import './Navbar.css';

function Navbar() {
    return (
        <div className="Navbar">
            <div>
            <li>
                <Link to="/AboutMe">About Me</Link>
            </li>
            <li>
                <Link to="/Experiences">Experiences</Link>
            </li>
            <li>
                <Link to="/Projects">Projects</Link>
            </li>
            <li>
                <Link to="/Skills">Skills</Link>
            </li>
        </div>     
        </div>
    );
}

export default Navbar;
